// src/App.js
import React, { useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import AOS from 'aos';
import 'aos/dist/aos.css';

// Main Pages
import Home from './pages/Home';
import Solutions from './pages/Solutions';
import Features from './pages/Features';
import Pricing from './pages/Pricing';
import Dashboard from './pages/Dashboard';
import FactCheck from './pages/FactCheck';

// Individual Solution Pages
import SchoolsSolution from './pages/Solutions/Schools';
import UniversitiesSolution from './pages/Solutions/Universities';
import LibrariesSolution from './pages/Solutions/Libraries';
import HRTeamsSolution from './pages/Solutions/HRTeams';
import StartupsSolution from './pages/Solutions/Startups';
import AILabsSolution from './pages/Solutions/AILabs';
import InfluencersSolution from './pages/Solutions/Influencers';
import EntrepreneursSolution from './pages/Solutions/Entrepreneurs';

// Import global styles
import './Styles/Style.css';

function App() {
  useEffect(() => {
    AOS.init({
      duration: 800,
      easing: 'ease-in-out',
      once: true,
      mirror: false,
      disable: window.innerWidth < 768
    });
  }, []);

  return (
    <Router>
      <Routes>
        {/* Main Routes */}
        <Route path="/" element={<Home />} />
        <Route path="/solutions" element={<Solutions />} />
        <Route path="/features" element={<Features />} />
        <Route path="/pricing" element={<Pricing />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/factcheck" element={<FactCheck />} />

        {/* Individual Solution Routes */}
        <Route path="/solutions/schools" element={<SchoolsSolution />} />
        <Route path="/solutions/universities" element={<UniversitiesSolution />} />
        <Route path="/solutions/libraries" element={<LibrariesSolution />} />
        <Route path="/solutions/hrteams" element={<HRTeamsSolution />} />
        <Route path="/solutions/startups" element={<StartupsSolution />} />
        <Route path="/solutions/ailabs" element={<AILabsSolution />} />
        <Route path="/solutions/influencers" element={<InfluencersSolution />} />
        <Route path="/solutions/entrepreneurs" element={<EntrepreneursSolution />} />
      </Routes>
    </Router>
  );
}

export default App;
